function fade() {
    var i = 0;
    var image = document.getElementsByClassName("sence")[0];
    image.style.opacity = 0;
    
    var k = window.setInterval(function() {
      
        if (i >= 200) {
            clearInterval(k);
        } else {
            image.style.opacity = i / 100;
            i++;
        }
    }, 200);
};

